INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (2, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "東山奈央", 100101, 44, "人助け、応援", 16, "ヒヨリ", "人助けが大好き！　前向き格闘娘", "獣人族", 0, 155, 8, 27, "A", "トゥインクルウィッシュ");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (2, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "種田梨沙", 100201, 47, "料理、人間観察", 17, "ユイ", "戦闘のサポートが得意な、心優しい少女", "ヒューマン", 0, 158, 4, 5, "O", "トゥインクルウィッシュ");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (2, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "早見沙織", 100301, 46, "読書、乗馬、お茶", 18, "レイ", "クールで何事にも真っ直ぐな剣士", "魔族", 0, 163, 1, 12, "B", "トゥインクルウィッシュ");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (5, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", "諸星すみれ", 100401, 27, "いたずら、探検", 9, "ミソギ", "探検好きのイタズラっ子", "ヒューマン", 0, 128, 8, 10, "O", "リトルリリカル");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (8, "？？？", "下田麻美", 100501, 40, "ヒーローごっこ", 12, "マツリ", "ヒーローに憧れる騎士見習いの少女", "獣人族", 0, 146, 11, 25, "O", "王宮騎士団（NIGHTMARE）");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (7, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", "浅倉杏美", 100601, 42, "サックス", 13, "アカリ", "甘え上手なみんなの人気者", "魔族", 0, 150, 11, 22, "O", "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (7, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "雨宮天", 100701, 32, "プリンを食べること", 14, "ミヤコ", "プリン大好きゴースト娘", "魔族", 0, 130, 1, 23, "B", "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (15, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "大空直美", 100801, 40, "鏡で自分を見ること", 14, "ユキ", "ボクは誰よりも美しい", "エルフ", 0, 150, 10, 10, "AB", "ヴァイスフリューゲル　ランドソル支部");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (13, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "髙野麻美", 100901, 45, "小説執筆", 17, "アンナ", "前世を信じる中二病患者、「疾風の冥姫」", "魔族", 0, 159, 7, 5, "A", "トワイライトキャラバン");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (10, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "内田真礼", 101001, 42, "空想、ぬいぐるみ集め", 16, "マホ", "マホマホ王国のプリンセス", "獣人族", 0, 155, 9, 22, "O", "自警団（カォン）");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (3, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "阿澄佳奈", 101101, 44, "お裁縫", 15, "リノ", "人懐っこくてマシンガントークな妹系少女", "ヒューマン", 0, 156, 8, 25, "A", "ラビリンス");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (6, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", "大橋彩香", 101201, 46, "妹と遊ぶこと、二度寝、昼寝、早寝", 17, "ハツネ", "みんなのために超能力を使う眠り姫", "エルフ", 0, 156, 12, 24, "A", "フォレスティエ");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (13, "", "佳村はるか", 101301, 55, "読書、魔法", 18, "ナナカ", "オタク全開な魔法少女", "魔族", 0, 166, 8, 21, "O", "トワイライトキャラバン");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (10, "test", "水瀬いのり", 101401, 41, "読書、推理", 15, "カスミ", "頭脳明晰な美少女名探偵", "獣人族", 0, 152, 11, 3, "AB", "自警団（カォン）");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (6, "test", "國府田マリ子", 101501, 54, "絵本作り", 21, "ミサト", "母性溢れる優しいみんなの「ミサト先生」", "エルフ", 0, 165, 9, 5, "O", "フォレスティエ");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (14, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", "上坂すみれ", 101601, 48, "ファッション", 17, "スズナ", "天真爛漫で人気者のカリスマモデル", "魔族", 0, 167, 4, 10, "O", "ルーセント学院");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (10, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", "高森奈津美", 101701, 53, "踊り、空手", 17, "カオリ", "いつでも「なんくるないさ～」な天然娘", "獣人族", 0, 158, 7, 7, "A", "自警団（カォン）");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (14, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", "伊藤静", 101801, 52, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 23, "イオ", "多くの男性を魅了する無垢な女教師", "魔族", 0, 162, 8, 14, "B", "ルーセント学院");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (5, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "日高里菜", 102001, 21, "かわいいもの集め", 10, "ミミ", "お歌もにんじんも、ウサギさんも大好き♪", "獣人族", 0, 117, 4, 3, "O", "リトルリリカル");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (9, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "植田佳奈", 102101, 40, "観劇、おままごと", 12, "クルミ", "泣き虫で臆病な守ってあげたい女の子", "ヒューマン", 0, 150, 6, 9, "B", "サレンディア救護院");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (7, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", "原紗友里", 102201, 40, "ゲーム全般", 13, "ヨリ", "人見知りであまのじゃくな女の子", "魔族", 0, 150, 11, 22, "O", "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (9, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "芹澤優", 102301, 38, "屋内でできる遊び", 14, "アヤネ", "ぷうきちといつも一緒！", "ヒューマン", 0, 148, 5, 10, "B", "サレンディア救護院");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (9, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "悠木碧", 102501, 43, "ご奉仕", 15, "スズメ", "お嬢さまのためにがんばるドジっ娘メイド", "ヒューマン", 0, 154, 12, 12, "O", "サレンディア救護院");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (11, "test", "小岩井ことり", 102601, 42, "あんパン", 17, "リン", "遊びと睡眠が何より大事なぐうたら娘", "獣人族", 0, 144, 1, 1, "B", "牧場（エリザベスパーク）");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (13, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "橋本ちなみ", 102701, 43, "実験、裁縫、料理", 16, "エリコ", "運命の相手に一途すぎる乙女", "魔族", 0, 154, 7, 30, "B", "トワイライトキャラバン");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (9, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", "堀江由衣", 102801, 43, "経営、お茶会", 17, "サレン", "救護院を経営する優しい庶民派お嬢様", "エルフ", 0, 156, 10, 4, "A", "サレンディア救護院");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (4, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", "日笠陽子", 102901, 40, "舞台鑑賞、ダンス", 17, "ノゾミ", "歌って踊れる大人気アイドル", "ヒューマン", 0, 157, 1, 24, "B", "カルミナ");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (15, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "佐藤聡美", 103001, 51, "忍法開発", 16, "ニノン", "トーゴクの神秘、オシエテクダサイ！", "ヒューマン", 0, 163, 8, 31, "O", "ヴァイスフリューゲル　ランドソル支部");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (7, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "大坪由佳", 103101, 42, "占い", 18, "シノブ", "占いが得意な霊能少女", "魔族", 0, 157, 12, 22, "AB", "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (12, "この私とともにいる限り、\nお金に不自由はさせませんわ！", "松嵜麗", 103201, 45, "慈善事業", 18, "アキノ", "一人前の商人を目指すパワフルお嬢様", "ヒューマン", 0, 157, 3, 12, "AB", "メルクリウス財団");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (11, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", "新田恵海", 103301, 35, "漫才", 20, "マヒル", "みんなを笑顔にするお笑い牧場主", "ヒューマン", 0, 142, 3, 3, "B", "牧場（エリザベスパーク）");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (12, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", "今井麻美", 103401, 55, "ウインドーショッピング", 22, "ユカリ", "純情でほっとけない大人の女性", "エルフ", 0, 164, 3, 16, "A", "メルクリウス財団");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (5, "test", "小倉唯", 103601, 21, "お勉強", 8, "キョウカ", "礼儀正しくしっかり者のちびっ子優等生", "エルフ", 0, 118, 2, 2, "A", "リトルリリカル");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (8, "test", "茅原実里", 103701, 43, "剣術、年長者をからかう", 13, "トモ", "義理堅くてからかい好きな剣術少女", "ヒューマン", 0, 149, 8, 11, "A", "王宮騎士団（NIGHTMARE）");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (11, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", "小清水亜美", 103801, 40, "読書、お散歩", 14, "シオリ", "読書が趣味の病弱少女", "獣人族", 0, 153, 11, 3, "A", "牧場（エリザベスパーク）");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (6, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", "花澤香菜", 104001, 44, "友達作りのイメトレ", 13, "アオイ", "「友達」に憧れる、エルフの森の女の子", "エルフ", 0, 158, 6, 6, "AB", "フォレスティエ");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (4, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "福原綾香", 104201, 46, "各種楽器", 17, "チカ", "人々を守るために歌う、唱喚士の少女", "ヒューマン", 0, 163, 6, 3, "O", "カルミナ");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (10, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", "小松未可子", 104301, 54, "お菓子作り", 17, "マコト", "男勝りで情に厚いワイルド娘", "獣人族", 0, 168, 8, 9, "O", "自警団（カォン）");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (7, "test", "丹下桜", 104401, 50, "世界征服", "??", "イリヤ", "かつては夜を支配した最強の吸血鬼", "魔族", 0, 172, 5, 5, "A", "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (15, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "長妻樹里", 104501, 49, "小説を読むこと", 18, "クウカ", "妄想大好き！　ほんとは照れ屋な女の子", "ヒューマン", 0, 157, 11, 19, "AB", "ヴァイスフリューゲル　ランドソル支部");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (12, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "沼倉愛美", 104601, 48, "猫とたわむれること", 19, "タマキ", "弱きを助け強きをくじく猫娘", "獣人族", 0, 158, 3, 1, "AB", "メルクリウス財団");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (8, "？？？", "川澄綾子", 104701, 50, "格闘技、湯浴み", 25, "ジュン", "素顔を見せない冷静沈着な女性騎士", "ヒューマン", 0, 171, 10, 25, "A", "王宮騎士団（NIGHTMARE）");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (12, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "田所あずさ", 104801, 49, "傭兵などのアルバイト", 20, "ミフユ", "仕事も私事も効率優先な傭兵少女", "ヒューマン", 0, 163, 11, 11, "O", "メルクリウス財団");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (3, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "生天目仁美", 104901, 54, "家事全般", 18, "シズル", "お姉ちゃんがお世話してあげるからねっ！", "ヒューマン", 0, 168, 10, 24, "O", "ラビリンス");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (14, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "久野美咲", 105001, 22, "ファッション誌鑑賞、コスメ集め", 11, "ミサキ", "ちょっとおませな恋に恋する女の子", "魔族", 0, 120, 1, 3, "A", "ルーセント学院");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (13, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", "三石琴乃", 105101, 53, "研究、実験", 27, "ミツキ", "実験が趣味の危険な科学者", "ヒューマン", 0, 166, 3, 7, "A", "トワイライトキャラバン");
