INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (15, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", "辻あゆみ", 105301, 33, "お菓子屋通い", 17, "モニカ", "見た目も中身もお子ちゃまな異国の軍人", "ヒューマン", 0, 140, 7, 28, "A", "ヴァイスフリューゲル　ランドソル支部");
