INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (9, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "悠木碧", 107701, 43, "ご奉仕", 15, "スズメ（サマー）", "お嬢さまのためにがんばるドジっ娘メイド", "ヒューマン", 0, 154, 12, 12, "O", "サレンディア救護院");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (1, "なに、モタモタしてんのよ\n仕方ないから、あたしが手伝ってあげるわ\nいい？　感謝しなさいよね！", "立花理香", 107801, 39, "猫と遊ぶ", 14, "キャル（サマー）", "行き倒れの謎のネコミミ魔法使い", "獣人族", 0, 152, 9, 2, "A", "美食殿");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (12, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "沼倉愛美", 107901, 48, "猫とたわむれること", 19, "タマキ（サマー）", "弱きを助け強きをくじく猫娘", "獣人族", 0, 158, 3, 1, "AB", "メルクリウス財団");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (12, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "田所あずさ", 108001, 49, "傭兵などのアルバイト", 20, "ミフユ（サマー）", "仕事も私事も効率優先な傭兵少女", "ヒューマン", 0, 163, 11, 11, "O", "メルクリウス財団");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (7, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "大坪由佳", 108101, 42, "占い", 18, "シノブ（ハロウィン）", "占いが得意な霊能少女", "魔族", 0, 157, 12, 22, "AB", "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (7, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "雨宮天", 108201, 32, "プリンを食べること", 14, "ミヤコ（ハロウィン）", "プリン大好きゴースト娘", "魔族", 0, 130, 1, 23, "B", "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (14, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "久野美咲", 108301, 22, "ファッション誌鑑賞、コスメ集め", 11, "ミサキ（ハロウィン）", "ちょっとおませな恋に恋する女の子", "魔族", 0, 120, 1, 3, "A", "ルーセント学院");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (4, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "福原綾香", 108401, 46, "各種楽器", 17, "チカ（クリスマス）", "人々を守るために歌う、唱喚士の少女", "ヒューマン", 0, 163, 6, 3, "O", "カルミナ");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (9, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "植田佳奈", 108501, 40, "観劇、おままごと", 12, "クルミ（クリスマス）", "泣き虫で臆病な守ってあげたい女の子", "ヒューマン", 0, 150, 6, 9, "B", "サレンディア救護院");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (9, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "芹澤優", 108601, 38, "屋内でできる遊び", 14, "アヤネ（クリスマス）", "ぷうきちといつも一緒！", "ヒューマン", 0, 148, 5, 10, "B", "サレンディア救護院");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (2, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "東山奈央", 108701, 44, "人助け、応援", 16, "ヒヨリ（ニューイヤー）", "人助けが大好き！　前向き格闘娘", "獣人族", 0, 155, 8, 27, "A", "トゥインクルウィッシュ");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (2, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "種田梨沙", 108801, 47, "料理、人間観察", 17, "ユイ（ニューイヤー）", "戦闘のサポートが得意な、心優しい少女", "ヒューマン", 0, 158, 4, 5, "O", "トゥインクルウィッシュ");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (2, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "早見沙織", 108901, 46, "読書、乗馬、お茶", 18, "レイ（ニューイヤー）", "クールで何事にも真っ直ぐな剣士", "魔族", 0, 163, 1, 12, "B", "トゥインクルウィッシュ");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (13, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "橋本ちなみ", 109001, 43, "実験、裁縫、料理", 16, "エリコ（バレンタイン）", "運命の相手に一途すぎる乙女", "魔族", 0, 154, 7, 30, "B", "トワイライトキャラバン");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (3, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "生天目仁美", 109101, 54, "家事全般", 18, "シズル（バレンタイン）", "お姉ちゃんがお世話してあげるからねっ！", "ヒューマン", 0, 168, 10, 24, "O", "ラビリンス");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES ("", "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", "日笠陽子", 109201, 55, "読書", 17, "アン", "英霊と契約を結んだマナリアの天才王女", "ヒューマン", 0, 156, 12, 1, "AB", "？？？");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES ("", "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", "こやまきみこ", 109301, 45, "食べること、眠ること", 16, "ルゥ", "マナリア魔法学院の新入生", "ヒューマン", 0, 144, 2, 4, "O", "？？？");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES ("", "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", "福原綾香", 109401, 67, "ピアノ", 17, "グレア", "人を超越した力を有す心優しい竜姫", "半人半竜", 0, 167, 11, 3, "B", "？？？");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (15, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "長妻樹里", 109501, 49, "小説を読むこと", 18, "クウカ（オーエド）", "妄想大好き！　ほんとは照れ屋な女の子", "ヒューマン", 0, 157, 11, 19, "AB", "ヴァイスフリューゲル　ランドソル支部");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (15, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "佐藤聡美", 109601, 51, "忍法開発", 16, "ニノン（オーエド）", "トーゴクの神秘、オシエテクダサイ！", "ヒューマン", 0, 163, 8, 31, "O", "ヴァイスフリューゲル　ランドソル支部");
