INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (12, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "沼倉愛美", 116801, 48, "猫とたわむれること", 19, "タマキ（作業服）", "弱きを助け強きをくじく猫娘", "獣人族", 0, 158, 3, 1, "AB", "メルクリウス財団");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (12, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "田所あずさ", 116901, 49, "傭兵などのアルバイト", 20, "ミフユ（作業服）", "仕事も私事も効率優先な傭兵少女", "ヒューマン", 0, 163, 11, 11, "O", "メルクリウス財団");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (13, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "橋本ちなみ", 117001, 43, "実験、裁縫、料理", 16, "エリコ（サマー）", "運命の相手に一途すぎる乙女", "魔族", 0, 154, 7, 30, "B", "トワイライトキャラバン");
