INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (4, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "福原綾香", 117301, 46, "各種楽器", 17, "チカ（サマー）", "人々を守るために歌う、唱喚士の少女", "ヒューマン", 0, 163, 6, 3, "O", "カルミナ");
