INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (13, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", "三石琴乃", 117501, 53, "研究、実験", 27, "ミツキ（オーエド）", "実験が趣味の危険な科学者", "ヒューマン", 0, 166, 3, 7, "A", "トワイライトキャラバン");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (15, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "大空直美", 117601, 40, "鏡で自分を見ること", 14, "ユキ（オーエド）", "ボクは誰よりも美しい", "エルフ", 0, 150, 10, 10, "AB", "ヴァイスフリューゲル　ランドソル支部");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (10, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", "高森奈津美", 117701, 53, "踊り、空手", 17, "カオリ（ハロウィン）", "いつでも「なんくるないさ～」な天然娘", "獣人族", 0, 158, 7, 7, "A", "自警団（カォン）");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (15, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "佐藤聡美", 117801, 51, "忍法開発", 16, "ニノン（ハロウィン）", "トーゴクの神秘、オシエテクダサイ！", "ヒューマン", 0, 163, 8, 31, "O", "ヴァイスフリューゲル　ランドソル支部");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (14, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", "上坂すみれ", 117901, 48, "ファッション", 17, "スズナ（ハロウィン）", "天真爛漫で人気者のカリスマモデル", "魔族", 0, 167, 4, 10, "O", "ルーセント学院");
