INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (13, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "髙野麻美", 121901, 45, "小説執筆", 17, "アンナ（パイレーツ）", "前世を信じる中二病患者、「疾風の冥姫」", "魔族", 0, 159, 7, 5, "A", "トワイライトキャラバン");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (7, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "大坪由佳", 122001, 42, "占い", 18, "シノブ（パイレーツ）", "占いが得意な霊能少女", "魔族", 0, 157, 12, 22, "AB", "悪魔偽王国軍（ディアボロス）");
