INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (2, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "早見沙織", 122501, 46, "読書、乗馬、お茶", 18, "レイ（サマー）", "クールで何事にも真っ直ぐな剣士", "魔族", 0, 163, 1, 12, "B", "トゥインクルウィッシュ");
